INSERT INTO `messagequestions` (`id`, `question`, `type`, `options`, `answers`) VALUES
(6944, 'Goals are ________ for innovative leaders', 'Single Answer', 'vital,essential,required', 'essential'),
(6945, '...if you think you can do it, that''s ___________, if you do it, that''s __________', 'Single Answer', 'competence-confidence,capability-potential,confidence-competence,potential-capability', 'confidence-competence'),
(6946, 'Leaders are also innovative in the fact that they are driven by ________', 'Single Answer', 'vision,purpose,goals,mission', 'goals'),
(6947, 'All true leaders possess a __________ attitude', 'Single Answer', 'leadership,goal-driven', 'goal-driven'),
(6948, 'Leadership is _______ attitude', 'Single Answer', '90%,80%,70%', '80%'),
(6949, 'Leaders distinguish themselves from followers by their passion for __________ goals', 'Single Answer', 'established,set,pre-established', 'pre-established'),
(6950, 'A lot of people create goals when?', 'Single Answer', 'Before Crisis,During Crisis,After Crisis', 'After Crisis'),
(6951, '...but innovative leaders create __________', 'Single Answer', 'goals before crisis,their own crisis', 'their own crisis'),
(6952, 'When we develop goals, we create ________', 'Single Answer', 'momentum,friction,velocity', 'friction'),
(6953, '...true leaders manage life more _________ because they create life themselves.', 'Single Answer', 'efficiently,effectively', 'effectively'),
(6954, '#3, leaders regulate their _______ and they measure their progress against prescribed goals', 'Single Answer', 'actions,activity,hobbies,routines', 'activity'),
(6955, 'Secret #1: Everyone in the world is a __________ in one way or another', 'Single Answer', 'leader,goal setter', 'goal setter'),
(6956, 'Secret #2: Even the ______ who is failing at life is setting goals to fail.', 'Single Answer', 'person,man', 'man'),
(6957, '...life is not a matter of what you do. It''s also a matter of what you don''t do. True or False?', 'Single Answer', 'True,False', 'True'),
(6958, '...many of us plan not to do things that will make us _________, that''s why we fail.', 'Single Answer', 'set goals,progress,successful', 'successful'),
(6959, 'Our lives depend on the goals we set and the ones we _______', 'Single Answer', 'don''t set,fail to set', 'fail to set'),
(6960, 'We should be driven by the decisions we make not what life decides to make for us. True or False?', 'Single Answer', 'True,False', 'True'),
(6961, 'He who aims at nothing will always ________', 'Single Answer', 'miss,hit it', 'hit it'),
(6962, 'Life only changes when we change our ______', 'Single Answer', 'decision,goals,actions', 'goals'),
(6963, 'Things in life don''t just happen, we _______ them to happen', 'Single Answer', 'permit,allow', 'allow'),
(6964, 'We fail not because we don''t set goals. We fail because we don''t set goals for the things we desire to ________', 'Single Answer', 'achieve,get done', 'achieve'),
(6965, '... and the desire never connects to where we are because we don''t create a _______ to take us there', 'Single Answer', 'route,path,map', 'path'),
(6966, 'Goals are the creation of a ________ to take us to our desired destination', 'Single Answer', 'part,path,way,route,street', 'path'),
(6967, 'Wrong goals lead to ___________ destination', 'Single Answer', 'any,wrong', 'wrong'),
(6968, 'Not making a plan is ________', 'Single Answer', 'no plan,a plan', 'a plan'),
(6969, 'Our lives should not just happen. True or False?', 'Single Answer', 'True,False', 'True'),
(6970, '... and if we''re going to be an effective leader, supervisor, manager, we''re going to have to stop living __________ because we''re setting goals', 'Single Answer', 'carelessly,anyhow,haphazardly', 'haphazardly'),
(6971, 'Leaders understand how to set _______', 'Single Answer', 'goals,the right goals', 'the right goals'),
(6972, 'Life is a matter of ______', 'Single Answer', 'setting goals,the right goals', 'the right goals'),
(6973, 'If you don''t know where you''re going, ________ will take you there.', 'Single Answer', 'a map,goals,any road', 'any road'),
(6974, 'What should determine the goals we set and the plans we make?', 'Single Answer', 'our purpose,our vision in life,all of the above', 'all of the above'),
(6975, 'Success comes from the discipline of goal-setting according to one''s ________', 'Single Answer', 'mission,calling,passion,purpose', 'purpose'),
(6976, 'Goals give our day ________, it stops us from drifting.', 'Single Answer', 'a chart,intent,direction', 'intent'),
(6977, 'Our ________ determines the design and nature of our goals.', 'Single Answer', 'purpose,vision,destination', 'destination'),
(6978, 'The source of our goal is our ________', 'Single Answer', 'purpose,vision,destination', 'destination'),
(6979, '________ is the parent of goals', 'Single Answer', 'Mission,Vision,Purpose', 'Purpose'),
(6980, 'Without purpose there is no _______ living', 'Single Answer', 'intentional,decided,precision', 'precision'),
(6981, '<strong>Many are the plans in a man''s heart but it is the Lord''s purpose that prevails.</strong> What bible verse is this?', 'Single Answer', 'Proverbs 18:21,Proverbs 19:21,Proverbs 20:21', 'Proverbs 19:21'),
(6982, '_________ is more important than plans', 'Single Answer', 'A Goal,Purpose,All of the above', 'Purpose'),
(6983, 'Purpose is more ________ than plans', 'Single Answer', 'directed,potent,powerful', 'powerful'),
(6984, 'Purpose ________ plans because the Creator established our purpose even before we were born', 'Single Answer', 'comes before,precedes,preceeds', 'precedes'),
(6985, 'There''s something God desired that made you necessary. True or False?', 'Single Answer', 'True,False', 'True'),
(6986, 'The word for purpose simply means __________', 'Single Answer', 'intention,reason,original intent', 'original intent'),
(6987, 'You were born because there is something God wanted done that required your presence. True or False?', 'Single Answer', 'True,False', 'True'),
(6988, 'No ________ makes a product and then try to figure out why. He always has purpose first.', 'Single Answer', 'inventor,CEO,manufacturer', 'manufacturer'),
(6989, 'Purpose _________ production', 'Single Answer', 'starts,creates', 'creates'),
(6990, 'Purpose _______ products', 'Single Answer', 'creates,produce', 'produce'),
(6991, '...when something is produced _______ made it come into being', 'Single Answer', 'goals,purpose', 'purpose'),
(6992, '_________ is what you were born to do', 'Single Answer', 'Job,Work', 'Work'),
(6993, '_________ is what you''re paid to do', 'Single Answer', 'Job,Work', 'Job'),
(6994, 'Your goal in life is to turn your job into your work. True or False?', 'Single Answer', 'True,False', 'True'),
(6995, 'Success is the fulfillment of __________', 'Single Answer', 'goals,purpose', 'purpose'),
(6996, 'Every purpose is achieved by a _______', 'Single Answer', 'goal,purpose,plan', 'plan'),
(6997, 'Plans may change but _________ is permanent', 'Single Answer', 'goals,purposes,purpose', 'purpose'),
(6998, 'Plans may change but purpose is permanent. What bible verse proves this?', 'Single Answer', 'Romans 11:1,Romans 11:30,Romans 11:29,Romans 11:36', 'Romans 11:29'),
(6999, 'Planning determines the value and quality you place on your _______', 'Single Answer', 'purpose,time', 'time'),
(7000, 'What you do in your down time determines what you become _________', 'Single Answer', 'in the future,in time', 'in time'),
(7001, 'Our down time is _________', 'Single Answer', 'after our regular job,during our job,during the day', 'after our regular job'),
(7002, 'When do we grow?', 'Single Answer', 'On our job,After our job', 'After our job'),
(7003, 'We will not become any better than what we do after ______', 'Single Answer', '12noon,5pm,1pm', '5pm'),
(7004, '<strong>In the morning sow thy seed, and in the evening withhold not thine hand: for thou know not whether shall prosper, either this or that, or whether they both shall be alike good.</strong> What bible verse is this?', 'Single Answer', 'Ecclesiastes 11:1,Ecclesiastes 11:6,Ecclesiastes 11:9', 'Ecclesiastes 11:6'),
(7005, 'When you work for yourself, you determine your salary. True or False?', 'Single Answer', 'True,False', 'True'),
(7006, 'A leader plans more in his down time than he does in his _______ time because he controls those hours', 'Single Answer', 'up,work', 'work'),
(7007, 'We are the sum total of how we use our time. True or False?', 'Single Answer', 'True,False', 'True'),
(7008, 'We become what we exchange our time for. True or False?', 'Single Answer', 'True,False', 'True'),
(7009, 'How we spend out time _________', 'Single Answer', 'makes us,creates who we are', 'creates who we are'),
(7010, 'If we keep watching TV, we''ll never be on TV. True or False?', 'Single Answer', 'True,False', 'True'),
(7011, '<strong>The preparations of the heart in man, and the answer of the tongue, is from the LORD.</strong> What bible verse is this?', 'Single Answer', 'Psalms 16:1,Proverbs 16:1,Ecclesiastes 16:1', 'Proverbs 16:1'),
(7012, '________ make(s) the plan', 'Single Answer', 'God,Humans', 'Humans'),
(7013, 'The reason why people don''t make big plans is because they believe they are to pay for them. True or False?', 'Single Answer', 'True,False', 'True'),
(7014, '<strong>A man''s heart devises his way: but the LORD directs his steps.</strong> What bible verse is this?', 'Single Answer', 'Proverbs 16:E,Proverbs 16:9,Proverbs 16:29', 'Proverbs 16:9'),
(7015, 'We frustrate ourselves when we try to _______ through our plans', 'Single Answer', 'jump,walk,leap', 'leap'),
(7016, 'A plan is a predetermined _________ for intentional progress toward a purpose or destiny', 'Single Answer', 'tactic,strategy', 'strategy'),
(7017, 'A plan is a predetermined strategy for _________ progress toward a purpose or destiny', 'Single Answer', 'intentional,deliberate', 'intentional'),
(7018, 'Goals are integrated parts of a plan that promotes the _________ of a purpose', 'Single Answer', 'achievement,fulfillment', 'fulfillment'),
(7019, 'God created man to live life in ___________', 'Single Answer', 'moments,days,weeks', 'days'),
(7020, 'Goals are incremental measures of ________', 'Single Answer', 'a destination,ultimate progress', 'ultimate progress'),
(7021, '<p>5 Keys to Planning:</p> #1 __________', 'Single Answer', 'identify an establish your goals,decide where you want to go', 'decide where you want to go'),
(7022, '<p>5 Keys to Planning:</p> #2 __________', 'Single Answer', 'decide where you want to go,identify and establish your goals', 'identify and establish your goals'),
(7023, '<p>5 Keys to Planning:</p> #3 __________', 'Single Answer', 'determine your destiny,prioritize your goals,identify and establish your goals', 'prioritize your goals'),
(7024, '<p>5 Keys to Planning:</p> #4 __________', 'Single Answer', 'determine your destiny,prioritize your goals,organize your goals', 'organize your goals'),
(7025, '<p>5 Keys to Planning:</p> #5 __________', 'Single Answer', 'organize your goals,discipline decisions by your goals', 'discipline decisions by your goals'),
(7026, 'You become effective when you follow a program that makes you concise and _________', 'Single Answer', 'intentional,disciplined,orderly', 'disciplined'),
(7027, 'Goals protect leaders from undue influence from other people. True or False?', 'Single Answer', 'True,False', 'True'),
(7028, 'True leaders are always zealous and jealous of their goals because their goals represent their __________', 'Single Answer', 'time,life', 'life'),
(7029, 'When our goals change, our lives change. True or False?', 'Single Answer', 'True,False', 'True'),
(7030, 'If you don''t set goals, others will set them for you. What bible verse proves this?', 'Single Answer', 'Proverbs 23:13,Proverbs 12:24,Proverbs 24:30,Proverbs 26:13', 'Proverbs 12:24'),
(7031, 'Retirement is a source of _________', 'Single Answer', 'senility,sanility', 'senility'),
(7032, 'We were never born to retire. True or False?', 'Single Answer', 'True,False', 'True'),
(7033, 'The minute we stop working, we start to die, because we were wired to work. True or False?', 'Single Answer', 'True,False', 'True'),
(7034, 'The more successful you become, people will ________ for your time.', 'Single Answer', 'fight,compete', 'compete'),
(7035, 'The more successful you become as a leader, you have to ________ your goals even more carefully.', 'Single Answer', 'protect,guard', 'guard'),
(7036, 'It''s hard work to be in demand, because more people want your time. And your ______ is all you have.', 'Single Answer', 'goal,time', 'time'),
(7037, 'The crowd will never let you go home, if you don''t go home. You have to get away from people. True or False?', 'Single Answer', 'True,False', 'True'),
(7038, 'We are to decide who has our time, because some people do not deserve our time. True or False?', 'Single Answer', 'True,False', 'True'),
(7039, '<strong>He that hath no rule over his own spirit is like a city that is broken down, and without walls.</strong> What bible verse is this?', 'Single Answer', 'Proverbs 25:27,Proverbs 25:28', 'Proverbs 25:28'),
(7040, '#1 Goals distinguish leaders from _________', 'Single Answer', 'subjects,everybody,followers', 'followers'),
(7041, '#2 Goals separate achievers from _______', 'Single Answer', 'wishful thinkers,dreamers', 'dreamers'),
(7042, '#3 Goals setting is the art of __________', 'Single Answer', 'control,discipline,rule', 'discipline'),
(7043, '#4 Goals are the skeleton of our plan, they give our plan ________', 'Single Answer', 'foundation,structure', 'structure'),
(7044, '#5 Goals give __________ to the plan', 'Single Answer', 'specifics,details', 'specifics'),
(7045, '#6 Goals create ________ for our energy', 'Single Answer', 'pointer,target', 'target'),
(7046, 'Without goals we lose energy and become depressed. True or False?', 'Single Answer', 'True,False', 'True'),
(7047, 'Were we created to live life by experiment?', 'Single Answer', 'Yes,No', 'No'),
(7048, '#7 Goals protect us from _________', 'Single Answer', 'postponing things,procrastination', 'procrastination'),
(7049, 'A goal is an established point for achievement that leads to a greater __________', 'Single Answer', 'achievement,accomplishment', 'accomplishment'),
(7050, 'A goal is a point of measure for progress toward an ultimate ________', 'Single Answer', 'destination,end,purpose', 'purpose'),
(7051, 'A goal is a prerequisite for the achievement for an ultimate ________', 'Single Answer', 'purpose,plan', 'plan'),
(7052, '______ Goals give us a starting place and an ending place.', 'Single Answer', '#1,#2,#3', '#2'),
(7053, 'The greatest enemy of right is _________', 'Single Answer', 'wrong,good', 'good'),
(7054, 'The greatest enemy of right is good, because good could prevent you from doing right. True or False?', 'Single Answer', 'True,False', 'True'),
(7055, 'A goal defines what is right for us and helps us say no to something good that doesn''t take us to our goal. True or False?', 'Single Answer', 'True,False', 'True'),
(7056, 'Every opportunity is not an opportunity, because it could be a ____________', 'Single Answer', 'trap,distraction,side track', 'distraction'),
(7057, '<p>The Principles of Goals</p> #1 Goals must be ________', 'Single Answer', 'simplified,defined', 'defined'),
(7058, '<p>The Principles of Goals</p> #2 Goals must be ________', 'Single Answer', 'defined,simplified', 'simplified'),
