INSERT INTO `scripturematerials` (`id`, `book`, `chapter`, `verse`, `words`, `reference`) VALUES
(77, 'Mark', 5, 37, 'Mark 5:37-And He permitted no one to accompany Him except Peter and James and John the brother of James.', 'Mark 5:37'),
(78, 'Mark', 5, 38, 'Mark 5:38-When they arrived at the house of the ruler of the synagogue, He looked at the tumult and the people weeping and wailing loudly.', 'Mark 5:38'),
(79, 'Mark', 5, 39, 'Mark 5:39-And when He had gone in, He said to them, Why do you make an uproar and weep? The little girl is not dead but sleeping?', 'Mark 5:39'),
(80, 'Mark', 5, 40, 'Mark 5:40-And they laughed and jeered at Him. But He put them all out, and, taking the child''s father and mother and those who were with Him, He went in where the little girl was lying.', 'Mark 5:40'),
(81, 'Mark', 5, 41, 'Mark 5:41-Gripping her by the hand, He said to her, Talitha cumi-which translated is, Little girl, I say to you, arise!', 'Mark 5:41'),
(82, 'Mark', 5, 42, 'Mark 5:42-And instantly the girl got up and started walking around-for she was twelve years old. And they were utterly astonished and overcome with amazement.', 'Mark 5:42'),
(83, 'Mark', 5, 43, 'Mark 5:43-And He strictly commanded and warned them that no one should know this, and He told them to give her something to eat.', 'Mark 5:43'),
(84, 'Matthew', 9, 1, 'Matthew 9:1-And Jesus, getting into a boat, crossed to the other side and came to His own town.', 'Matthew 9:1'),
(85, 'Matthew', 9, 2, 'Matthew 9:2-And behold, they brought to Him a man paralyzed and prostrated by illness, lying on a sleeping pad; and when Jesus saw their faith, He said to the paralyzed man, Take courage, son; your sins are forgiven and the penalty remitted.', 'Matthew 9:2'),
(86, 'Matthew', 9, 3, 'Matthew 9:3-And behold, some of the scribes said to themselves, This man blasphemes!', 'Matthew 9:3'),
(87, 'Matthew', 9, 4, 'Matthew 9:4-But Jesus, knowing their thoughts, said, Why do you think evil and harbor malice in your hearts?', 'Matthew 9:4'),
(88, 'Matthew', 9, 5, 'Matthew 9:5-For which is easier: to say, Your sins are forgiven and the penalty remitted, or to say, Get up and walk?', 'Matthew 9:5'),
(89, 'Matthew', 9, 6, 'Matthew 9:6-But in order that you may know that the Son of Man has authority on earth to forgive sins and remit the penalty, He then said to the paralyzed man, Get up! Pick up your sleeping pad and go to your own house.', 'Matthew 9:6'),
(90, 'Matthew', 9, 7, 'Matthew 9:7-And he got up and went away to his own house.', 'Matthew 9:7'),
(91, 'Matthew', 9, 8, 'Matthew 9:8-When the crowds saw it, they were struck with fear and awe; and they recognized God and praised and thanked Him, Who had given such power and authority to men.', 'Matthew 9:8'),
(92, 'Matthew', 9, 9, 'Matthew 9:9-As Jesus passed on from there, He saw a man named Matthew sitting at the tax collector''s office; and He said to him, Follow Me. And he rose and followed Him.', 'Matthew 9:9'),
(93, 'Matthew', 9, 10, 'Matthew 9:10-And as Jesus reclined at table in the house, behold, many tax collectors and sinners came and sat with Him and His disciples.', 'Matthew 9:10'),
(94, 'Matthew', 9, 11, 'Matthew 9:11-And when the Pharisees saw this, they said to His disciples, Why does your Master eat with tax collectors and sinners?', 'Matthew 9:11'),
(95, 'Matthew', 9, 12, 'Matthew 9:12-But when Jesus heard it, He replied, Those who are strong and well have no need of a physician, but those who are weak and sick.', 'Matthew 9:12'),
(96, 'Matthew', 9, 13, 'Matthew 9:13-Go and learn what this means: I desire mercy and not sacrifice and sacrificial victims. For I came not to call and invite the righteous, but sinners.', 'Matthew 9:13'),
(97, 'Matthew', 9, 14, 'Matthew 9:14-Then the disciples of John came to Jesus, inquiring, Why is it that we and the Pharisees fast often, but Your disciples do not fast?', 'Matthew 9:14'),
(98, 'Matthew', 9, 15, 'Matthew 9:15-And Jesus replied to them, Can the wedding guests mourn while the bridegroom is still with them? The days will come when the bridegroom is taken away from them, and then they will fast.', 'Matthew 9:15'),
(99, 'Matthew', 9, 16, 'Matthew 9:16-And no one puts a piece of cloth that has not been shrunk on an old garment, for such a patch tears away from the garment and a worse rent is made.', 'Matthew 9:16'),
(100, 'Matthew', 9, 17, 'Matthew 9:17-Neither is new wine put in old wineskins; for if it is, the skins burst and are torn in pieces, and the wine is spilled and the skins are ruined. But new wine is put into fresh wineskins, and both are preserved.', 'Matthew 9:17'),
(101, 'Matthew', 9, 18, 'Matthew 9:18-While He was talking this way to them, behold, a ruler entered and, kneeling down, worshiped Him, saying, My daughter has just now died; but come and lay Your hand on her, and she will come to life.', 'Matthew 9:18'),
(102, 'Matthew', 9, 19, 'Matthew 9:19-And Jesus got up and accompanied him, with His disciples.', 'Matthew 9:19'),
(103, 'Matthew', 9, 20, 'Matthew 9:20-And behold, a woman who had suffered from a flow of blood for twelve years came up behind Him and touched the fringe of His garment;', 'Matthew 9:20'),
(104, 'Matthew', 9, 21, 'Matthew 9:21-For she kept saying to herself, If I only touch His garment, I shall be restored to health.', 'Matthew 9:21'),
(105, 'Matthew', 9, 22, 'Matthew 9:22-Jesus turned around and, seeing her, He said, Take courage, daughter! Your faith has made you well. And at once the woman was restored to health.', 'Matthew 9:22'),
(106, 'Matthew', 9, 23, 'Matthew 9:23-And when Jesus came to the ruler''s house, and saw the minstrels and the people making a noise,', 'Matthew 9:23'),
(107, 'Matthew', 9, 24, 'Matthew 9:24-He said to them, Give place: for the maid is not dead, but sleeps. And they laughed Him to scorn.', 'Matthew 9:24'),
(108, 'Matthew', 9, 25, 'Matthew 9:25-But when the people were put out, He went in, and took her by the hand, and the girl arose.', 'Matthew 9:25'),
(109, 'Matthew', 9, 26, 'Matthew 9:26-And the fame hereof went abroad into all that land.', 'Matthew 9:26'),
(110, 'Matthew', 9, 27, 'Matthew 9:27-When Jesus departed from there, two blind men followed Him, crying, and saying, Son of David, have mercy on us.', 'Matthew 9:27'),
(111, 'Matthew', 9, 28, 'Matthew 9:28-And when He came into the house, the blind men came to Him: and Jesus said to them, Do you believe that I am able to do this? They said to Him, Yes, Lord.', 'Matthew 9:28'),
(112, 'Matthew', 9, 29, 'Matthew 9:29-Then He touched their eyes, saying, According to your faith be it unto you.', 'Matthew 9:29'),
(113, 'Matthew', 9, 30, 'Matthew 9:30-And their eyes were opened; and Jesus strictly charged them, saying, See that no man know it.', 'Matthew 9:30'),
(114, 'Matthew', 9, 31, 'Matthew 9:31-But they, when they departed, spread abroad His fame in all that country.', 'Matthew 9:31'),
(115, 'Matthew', 9, 32, 'Matthew 9:32-As they went out, behold, they brought to Him a dumb man possessed with a devil.', 'Matthew 9:32'),
(116, 'Matthew', 9, 33, 'Matthew 9:33-And when the devil was cast out, the dumb spoke: and the multitudes marveled, saying, It was never so seen in Israel.', 'Matthew 9:33'),
(117, 'Matthew', 9, 34, 'Matthew 9:34-But the Pharisees said, He casts out devils through the prince of devils.', 'Matthew 9:34'),
(118, 'Matthew', 9, 35, 'Matthew 9:35-And Jesus went about all the cities and villages, teaching in their synagogues, and preaching the gospel of the kingdom, and healing every sickness and every disease among the people.', 'Matthew 9:35'),
(119, 'Matthew', 9, 36, 'Matthew 9:36-But when He saw the multitudes, He was moved with compassion on them, because they fainted, and were scattered abroad, as sheep having no shepherd.', 'Matthew 9:36'),
(120, 'Matthew', 9, 37, 'Matthew 9:37-Then He said to His disciples, The harvest truly is plenteous, but the laborers are few;', 'Matthew 9:37'),
(121, 'Matthew', 9, 38, 'Matthew 9:38-Pray therefore the Lord of the harvest, that He will send forth laborers into His harvest.', 'Matthew 9:38'),
(122, 'Matthew', 10, 1, 'Matthew 10:1-And when He had called to His twelve disciples, He gave them power against unclean spirits, to cast them out, and to heal all manner of sickness and all manner of disease.', 'Matthew 10:1'),
(123, 'Matthew', 10, 2, 'Matthew 10:2-Now the names of the twelve apostles are these; The first, Simon, who is called Peter, and Andrew his brother; James the son of Zebedee, and John his brother;', 'Matthew 10:2'),
(124, 'Matthew', 10, 3, 'Matthew 10:3-Philip, and Bartholomew; Thomas, and Matthew the publican; James the son of Alphaeus, and Lebbaeus, whose surname was Thaddaeus;', 'Matthew 10:3'),
(125, 'Matthew', 10, 4, 'Matthew 10:4-Simon the Canaanite, and Judas Iscariot, who also betrayed Him.', 'Matthew 10:4'),
(126, 'Matthew', 10, 5, 'Matthew 10:5-These twelve Jesus sent forth, and commanded them, saying, Do not go into the way of the Gentiles, and into any city of the Samaritans do not enter:', 'Matthew 10:5'),
(127, 'Matthew', 10, 6, 'Matthew 10:6-But go rather to the lost sheep of the house of Israel.', 'Matthew 10:6'),
(128, 'Matthew', 10, 7, 'Matthew 10:7-And as you go, preach, saying, The kingdom of heaven is at hand.', 'Matthew 10:7'),
(129, 'Matthew', 10, 8, 'Matthew 10:8-Heal the sick, cleanse the lepers, raise the dead, cast out devils: freely you have received, freely give.', 'Matthew 10:8'),
(130, 'Matthew', 10, 9, 'Matthew 10:9-Provide neither gold, nor silver, nor brass in your purses,', 'Matthew 10:9'),
(131, 'Matthew', 10, 10, 'Matthew 10:10-Nor scrip for your journey, neither two coats, neither shoes, nor yet staves: for the workman is worthy of his meat.', 'Matthew 10:10'),
(132, 'Matthew', 10, 11, 'Matthew 10:11-And into whatsoever city or town you shall enter, inquire who in it is worthy; and there abide till you go.', 'Matthew 10:11'),
(133, 'Matthew', 10, 12, 'Matthew 10:12-And when you come into a house, salute it.', 'Matthew 10:12'),
(134, 'Matthew', 10, 13, 'Matthew 10:13-And if the house is worthy, let your peace come upon it: but if it is not worthy, let your peace return to you.', 'Matthew 10:13'),
(135, 'Matthew', 10, 14, 'Matthew 10:14-And whosoever shall not receive you, nor hear your words, when you depart out of that house or city, shake off the dust of your feet.', 'Matthew 10:14'),
(136, 'Matthew', 10, 15, 'Matthew 10:15-Verily I say to you, It shall be more tolerable for the land of Sodom and Gomorrha in the day of judgment, than for that city.', 'Matthew 10:15'),
(137, 'Matthew', 10, 16, 'Matthew 10:16-Behold, I send you forth as sheep in the midst of wolves: be therefore wise as serpents, and harmless as doves.', 'Matthew 10:16'),
(138, 'Matthew', 10, 17, 'Matthew 10:17-But beware of men: for they will deliver you up to the councils, and they will scourge you in their synagogues;', 'Matthew 10:17'),
(139, 'Matthew', 10, 18, 'Matthew 10:18-And you shall be brought before governors and kings for My sake, for a testimony against them and the Gentiles.', 'Matthew 10:18'),
(140, 'Matthew', 10, 19, 'Matthew 10:19-But when they deliver you up, take no thought how you will speak: for it will be given you in that same hour what you will speak.', 'Matthew 10:19'),
(141, 'Matthew', 10, 20, 'Matthew 10:20-For it is not you that speak, but the Spirit of your Father who speaks in you.', 'Matthew 10:20'),
(142, 'Matthew', 10, 21, 'Matthew 10:21-And the brother shall deliver up the brother to death, and the father the child: and the children shall rise up against their parents, and cause them to be put to death.', 'Matthew 10:21'),
(143, 'Matthew', 10, 22, 'Matthew 10:22-And you will be hated of all men for My name''s sake:', 'Matthew 10:22'),
(144, 'Matthew', 10, 23, 'Matthew 10:23-But when they persecute you in this city, flee into another: for verily I say to you, You will not have gone over the cities of Israel, till the Son of man come.', 'Matthew 10:23'),
(145, 'Matthew', 10, 24, 'Matthew 10:24-The disciple is not above his master, nor the servant above his lord.', 'Matthew 10:24'),
(146, 'Matthew', 10, 25, 'Matthew 10:25-It is enough for the disciple that he be as his master, and the servant as his lord. If they have called the master of the house Beelzebub, how much more will they call them of the household?', 'Matthew 10:25'),
(147, 'Matthew', 10, 26, 'Matthew 10:26-Fear them not therefore: for there is nothing covered, that shall not be revealed; and hid, that shall not be known.', 'Matthew 10:26'),
(148, 'Matthew', 10, 27, 'Matthew 10:27-What I tell you in darkness, speak it in light: and what you hear in the ear, preach it upon the housetops.', 'Matthew 10:27'),
(149, 'Matthew', 10, 28, 'Matthew 10:28-And fear not them who kill the body, but are not able to kill the soul: but rather fear Him who is able to destroy both soul and body in hell.', 'Matthew 10:28'),
(150, 'Matthew', 10, 29, 'Matthew 10:29-Are not two sparrows sold for a farthing (quarter of a penny)? and one of them shall not fall on the ground without your Father.', 'Matthew 10:29'),
(151, 'Matthew', 10, 30, 'Matthew 10:30-But the very hairs of your head are all numbered.', 'Matthew 10:30'),
(152, 'Matthew', 10, 31, 'Matthew 10:31-Fear not therefore, you are of more value than many sparrows.', 'Matthew 10:31'),
(153, 'Matthew', 10, 32, 'Matthew 10:32-Whosoever therefore shall confess Me before men, him will I confess also before My Father who is in heaven.', 'Matthew 10:32'),
(154, 'Matthew', 10, 33, 'Matthew 10:33-But whosoever shall deny Me before men, him will I also deny before My Father who is in heaven.', 'Matthew 10:33'),
(155, 'Matthew', 10, 34, 'Matthew 10:34-Do not think I came to send peace on earth: I came not to send peace, but a sword.', 'Matthew 10:34'),
(156, 'Matthew', 10, 35, 'Matthew 10:35-For I came to set a man at variance against his father, and the daughter against her mother, and the daughter in law against her mother in law.', 'Matthew 10:35'),
(157, 'Matthew', 10, 36, 'Matthew 10:36-And a man''s foes shall be they of his own household.', 'Matthew 10:36'),
(158, 'Matthew', 10, 37, 'Matthew 10:37-He that loves father or mother more than Me is not worthy of Me: and he that loves son or daughter more than Me is not worthy of Me.', 'Matthew 10:37'),
(159, 'Matthew', 10, 38, 'Matthew 10:38-And he that takes not his cross, and follows after Me, is not worthy of Me.', 'Matthew 10:38'),
(160, 'Matthew', 10, 39, 'Matthew 10:39-He that finds his life will lose it: and he that loses his life for My sake will find it.', 'Matthew 10:39'),
(161, 'Matthew', 10, 40, 'Matthew 10:40-He that receives you receives Me, and he that receives Me receives him that sent Me.', 'Matthew 10:40'),
(162, 'Matthew', 10, 41, 'Matthew 10:41-He that receives a prophet in the name of a prophet will receive a prophet''s reward; and he that receives a righteous man in the name of a righteous man will receive a righteous man''s reward.', 'Matthew 10:41'),
(163, 'Matthew', 10, 42, 'Matthew 10:42-And whosoever shall give to drink unto one of these little ones a cup of cold water only in the name of a disciple, verily I say to you, he will in no wise lose his reward.', 'Matthew 10:42'),
(164, 'Matthew', 14, 1, 'Matthew 14:1-At that time Herod the tetrarch heard of the fame of Jesus,', 'Matthew 14:1'),
(165, 'Matthew', 14, 2, 'Matthew 14:2-And said to his servants, This is John the Baptist; he is risen from the dead; and therefore mighty works show forth themselves in him.', 'Matthew 14:2'),
(166, 'Matthew', 14, 3, 'Matthew 14:3-For Herod had laid hold on John, and bound him, and put him in prison for Herodias'' sake, his brother Philip''s wife.', 'Matthew 14:3'),
(167, 'Matthew', 14, 4, 'Matthew 14:4-For John said to him, it is not lawful for you to have her.', 'Matthew 14:4'),
(168, 'Matthew', 14, 5, 'Matthew 14:5-And when he would have put him (John) to death, he feared the multitude, because they counted him as a prophet.', 'Matthew 14:5'),
(169, 'Matthew', 14, 6, 'Matthew 14:6-But when Herod''s birthday was kept, the daughter of Herodias danced before them, and pleased Herod.', 'Matthew 14:6'),
(170, 'Matthew', 14, 7, 'Matthew 14:7-Where he promised with an oath to give her whatsoever she would ask.', 'Matthew 14:7'),
(171, 'Matthew', 14, 8, 'Matthew 14:8-And she, being before instructed of her mother, said, Give me here John the Baptist''s head in a charger.', 'Matthew 14:8'),
(172, 'Matthew', 14, 9, 'Matthew 14:9-And the king was sorry: nevertheless for the oath''s sake, and them who sat with him at meat, he commanded it to be given her.', 'Matthew 14:9'),
(173, 'Matthew', 14, 10, 'Matthew 14:10-And he sent, and beheaded John in prison.', 'Matthew 14:10'),
(174, 'Matthew', 14, 11, 'Matthew 14:11-And his head was brought in a charger, and given to the damsel: and she brought it to her mother.', 'Matthew 14:11'),
(175, 'Matthew', 14, 12, 'Matthew 14:12-And his disciples came, and took up the body, and buried it, and went and told Jesus.', 'Matthew 14:12'),
(176, 'Matthew', 14, 13, 'Matthew 14:13-When Jesus heard of it, He departed from there by ship into a desert place apart: and when the people had heard, they followed Him on foot out of the cities.', 'Matthew 14:13'),
(177, 'Matthew', 14, 14, 'Matthew 14:14-And Jesus went forth, and saw a great multitude, and was moved with compassion toward them, and He healed their sick.', 'Matthew 14:14'),
(178, 'Matthew', 14, 15, 'Matthew 14:15-And when it was evening, His disciples came to Him, saying, This is a desert place, and the time is now past; send the multitudes away, that they may go into the villages, and buy themselves victuals.', 'Matthew 14:15'),
(179, 'Matthew', 14, 16, 'Matthew 14:16-But Jesus said to them, They need not depart; you give them to eat.', 'Matthew 14:16'),
(180, 'Matthew', 14, 17, 'Matthew 14:17-And they said to Him, We have here but 5 loaves and 2 fishes.', 'Matthew 14:17'),
(181, 'Matthew', 14, 18, 'Matthew 14:18-He said, Bring them to Me.', 'Matthew 14:18'),
(182, 'Matthew', 14, 19, 'Matthew 14:19-And He commanded the multitude to sit down on the grass, and took the 5 loaves, and the 2 fishes, and looking up to heaven, he blessed, and brake, and gave the loaves to His disciples, and the disciples to the multitude.', 'Matthew 14:19'),
(183, 'Matthew', 14, 20, 'Matthew 14:20-And they did all eat, and were filled: and they took up of the fragments that remained 12 baskets full.', 'Matthew 14:20'),
(184, 'Matthew', 14, 21, 'Matthew 14:21-And they that had eaten were about 5,000 men, beside women and children.', 'Matthew 14:21'),
(185, 'Matthew', 14, 22, 'Matthew 14:22-And straightway Jesus constrained His disciples to get into a ship, and to go before Him to the other side, while He sent the multitudes away.', 'Matthew 14:22'),
(186, 'Matthew', 14, 23, 'Matthew 14:23-And when He had sent the multitudes away, He went up into a mountain apart to pray: and when the evening came, He was there alone.', 'Matthew 14:23'),
(187, 'Matthew', 14, 24, 'Matthew 14:24-But the ship was now in the midst of the sea, tossed with waves: for the wind was contrary.', 'Matthew 14:24'),
(188, 'Matthew', 14, 25, 'Matthew 14:25-And in the 4th watch of the night Jesus went to them, walking on the sea.', 'Matthew 14:25'),
(189, 'Matthew', 14, 26, 'Matthew 14:26-And when the disciples saw Him walking on the sea, they were troubled, saying, It is a spirit; and they cried out for fear.', 'Matthew 14:26'),
(190, 'Matthew', 14, 27, 'Matthew 14:27-But straightway Jesus spoke to them, saying, Be of good cheer; It is I; be not afraid.', 'Matthew 14:27'),
(191, 'Matthew', 14, 28, 'Matthew 14:28-And Peter answered Him and said, Lord, if it is You, bid me come to You on the water.', 'Matthew 14:28'),
(192, 'Matthew', 14, 29, 'Matthew 14:29-And He said, Come. And when Peter came down out of the ship, he walked on the water, to go to Jesus.', 'Matthew 14:29'),
(193, 'Matthew', 14, 30, 'Matthew 14:30-But when he saw the wind boisterous, he was afraid; and beginning to sink, he cried, saying, Lord, save me.', 'Matthew 14:30'),
(194, 'Matthew', 14, 31, 'Matthew 14:31-And immediately Jesus stretched forth His hand, and caught him, and said to him, O you of little faith, why did you doubt?', 'Matthew 14:31'),
(195, 'Matthew', 14, 32, 'Matthew 14:32-And when they came into the ship, the wind ceased.', 'Matthew 14:32'),
(196, 'Matthew', 14, 33, 'Matthew 14:33-Then they that were in the ship came and worshiped Him, saying, Of a truth You are the Son of God.', 'Matthew 14:33'),
(197, 'Matthew', 14, 34, 'Matthew 14:34-And when they were gone over, they came into the land of Gennesaret.', 'Matthew 14:34'),
(198, 'Matthew', 14, 35, 'Matthew 14:35-And when the men of that place had knowledge of Him, they sent out into all the country round about, and brought to Him all that were diseased;', 'Matthew 14:35'),
(199, 'Matthew', 14, 36, 'Matthew 14:36-And besought Him that they might only touch the hem of His garment: and as many as touched were made perfectly whole.', 'Matthew 14:36'),
(200, 'Mark', 6, 1, 'Mark 6:1-And He went out from there, and came into His own country; and His disciples followed Him.', 'Mark 6:1'),
(201, 'Mark', 6, 2, 'Mark 6:2-And when the sabbath day came, He began to teach in the synagogue: and many hearing Him were astonished, saying, From where has this man these things? and what wisdom is this which is given to Him, that even such mighty works are wrought by His hands?', 'Mark 6:2'),
(202, 'Mark', 6, 3, 'Mark 6:3-Is this not the Carpenter, the son of Mary, the Brother of James, and Joses, and of Juda, and Simon? and are His sisters not here with us? And they were offended at Him.', 'Mark 6:3'),
(203, 'Mark', 6, 4, 'Mark 6:4-But Jesus said to them, A prophet is not without honor, but in His own country, and among His own kin, and in His own house.', 'Mark 6:4'),
(204, 'Mark', 6, 5, 'Mark 6:5-And He could there do no mighty work, except that He laid His hands upon a few sick folk, and healed them.', 'Mark 6:5'),
(205, 'Mark', 6, 6, 'Mark 6:6-And He marveled because of their unbelief. And He went round about the villages, teaching.', 'Mark 6:6'),
(206, 'Mark', 6, 7, 'Mark 6:7-And He called to Him the 12, and began to send them forth by 2 and 2; and gave them power over unclean spirits;', 'Mark 6:7'),
